superMiscConds.notes:
Defendant shall pay supervisory fees to the Department of Corrections;
Defendant shall successfully complete any/all counseling, evaluations, assessments and follow-up as deemed necessary;
Defendant shall maintain absolute sobriety and not possess/consume any alcohol, controlled substances (unless prescribed by a physician) or drug paraphernalia;
Defendant shall provide a DNA sample and pay surcharge;
Defendant shall register as a sex offender.
Defendant shall not have contact with anyone under the age of 18 without supervision and agent permission.
Defendant shall not have access to computers.
